import "./Content.css";
class Content extends React.Component {
    render() {
        return (
            <>
               {/* <Gallery/>  */}
               <div className="content">

              
               <Slide/>
               <CarouselMusic/>
               <App/>
             </div>
            </>
        );
    }
}
export default Content;
